import React from "react";
import Navbar from "../components/Navbar";

function Page(props) {
  console.log(props.signtype);
  return (
    <div>
      <Navbar
        sign={{ isSign: props.sign.isSign, type: props.sign.type }}
      ></Navbar>
    </div>
  );
}

export default Page;
